INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 102301, 10046, "アヤネ", 24001, 0.0, 0.0, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 102301, 10046, "アヤネ", 24002, 2.21, 0.0, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 102301, 10046, "アヤネ", 24003, 0.0, 0.0, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192201, 10046, "アサヒ", 24004, 1.99, 0.0, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192201, 10046, "アサヒ", 24005, 2.21, 0.0, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192201, 10046, "アサヒ", 24006, 3.33, 0.0, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192301, 10046, "部員３", 24007, 0.0, 0.0, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192301, 10046, "部員３", 24008, 2.68, 0.0, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192301, 10046, "部員３", 24009, 0.0, 0.0, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192501, 10046, "", 24010, 0.0, 0.0, 501, "やった！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192501, 10046, "", 24011, 0.0, 0.0, 502, "勝ったよ！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192501, 10046, "", 24012, 0.0, 0.0, 503, "いい調子！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 6, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24013, 5.33, 0.0, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24014, 6.85, 0.0, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24015, 3.0, 0.0, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192401, 10046, "ダイチ", 24016, 6.11, 0.0, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192401, 10046, "ダイチ", 24017, 6.75, 0.0, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192401, 10046, "ダイチ", 24018, 0.0, 0.0, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113401, 10046, "ハツネ", 24019, 4.52, 0.0, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113401, 10046, "ハツネ", 24020, 3.89, 0.0, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 113401, 10046, "ハツネ", 24021, 13.49, 0.0, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 106501, 10046, "カヤ", 24022, 3.17, 0.0, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 106501, 10046, "カヤ", 24023, 4.42, 0.0, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 6, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 106501, 10046, "カヤ", 24024, 2.89, 0.0, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 4, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 102301, 10046, "アヤネ", 24025, 3.71, 0.0, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192201, 10046, "アサヒ", 24026, 5.1, 0.0, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192301, 10046, "部員３", 24027, 4.34, 0.0, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", 192501, 10046, "", 24028, 0.0, 0.0, 521, "いい勝負だったよ\nまたやろうね", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24029, 5.62, 0.0, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24030, 9.58, 0.0, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24031, 0.0, 0.0, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 2, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24032, 9.13, 0.0, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, 1, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", 113501, 10046, "ミサト", 24033, 8.27, 0.0, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2);
